// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";


//------------------------------------------------------------------------------
// token contract
//------------------------------------------------------------------------------
/**
 * @title Recharge
 * @dev terranart.eth
 * @dev ERC20 standard based token with additional features for NFT purchases and matic to token exchange
 *      - mintable: minting tokens
 *      - burnable: burning tokens
 *      - lockable: lockable functions
 *      - purchasable: purchasing tokens with base currency
 *      - transferable: transferring tokens
 *  Todo add an nft purchase interface
 *
 */
contract Recharge is AccessControlEnumerable, ERC20Burnable {
// roles
    bytes32 public constant DAO_ROLE = keccak256("DAO_ROLE");
    bytes32 public constant OWNER_ROLE = keccak256("OWNER_ROLE");
    bytes32 public constant BALLOT_ROLE = keccak256("BALLOT_ROLE");
    bytes32 public constant NFT_ROLE = keccak256("NFT_ROLE");
// variables
    Recharge public self; // this contract
    uint256 public initialSupply;
    uint256 private price; // this token price in wei conversion needs to happen on front end
    uint256 private nftPrice; // this nft price in wei conversion needs to happen on front end
    bool[2] public locked; // locks for functions
    uint256 private paypoll; // the amount of wei to pay to the ballot contract

// modifiers   

    modifier unlocked(uint256 _function) {
        require(locked[_function] == false, "Function is locked");
        _;
    }

    modifier onlyBallot {
        require(hasRole(BALLOT_ROLE, _msgSender()), "Ballot Role required");
         _;
    }

    modifier onlyOwner {
        require(hasRole(OWNER_ROLE, _msgSender()), "Must be Owner");
        _;
    }

    modifier onlyDAO {
        require(hasRole(DAO_ROLE, _msgSender()), "DAO Role required");
        _;
    }

// events
    event RoleGranted(bytes32 indexed role, address indexed account); // role granted
    event RoleRevoked(bytes32 indexed role, address indexed account); // role revoked
    event Minted(address indexed to, uint256 value); // new tokens minted
    event Burned(address indexed from, uint256 value); // tokens burned
    event LockStateChanged(uint256 indexed func, bool isLocked); // lock state changed
    event PriceChanged(uint256 newPrice); // price of token in base coin changed
    event BuyTokens(address indexed buyer, uint256 value, uint256 quantity); // tokens purchased with base coin
    event PollPaid(address indexed voter, uint256 value); // voter paid for participation in poll
    event PolltobePaid(uint256 value); // amount of wei to be paid for participation in poll
    event NftPurchased(address indexed buyer, uint256 value); // nft purchased with token
    event NftSet(address indexed nftAddress, uint256 tokenId); // nft address set of purchasaable nft
    event Withdrawn(address indexed from, uint256 value); // amount of wei withdrawn from contract

// constructor
    /**
     * @dev Grants Default roles to creator.
     * mints total supply to contract
     *
     * See {ERC20-constructor}.
     */
    constructor(string memory name, string memory symbol) ERC20(name, symbol) {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(OWNER_ROLE, _msgSender());
        _setupRole(DAO_ROLE, _msgSender()); // after dao is running we should remove ourself from the dao
        // default price is matched to base coin
        price = 1;
        // setup self
        self = Recharge(this);
        // launch origin mint
        initialSupply = (10000000000000000000000000000); // 10 Billion Tokens in wei
        mint(address(self), initialSupply); //minting 10 Billion to the contract
    }
// receive
    receive () external payable {
    // if someone sends matic they get recharge automatically
    // this is wei to wei conversion needs to happen on front end, see setTokenPrice
        uint256 quantity = msg.value * price;

        // check if the Vendor Contract has enough amount of tokens for the transaction
        uint256 contractBalance = self.balanceOf(address(this));
        require(contractBalance >= quantity, "token contract has not enough tokens in its balance");

        // Transfer token to the msg.sender
        (bool sent) = self.transfer(msg.sender, quantity);
        require(sent, "Failed to transfer token to user");

        // emit the event
        emit BuyTokens(msg.sender, msg.value, quantity);
  }

// functions
    /**
     * @dev Creates `amount` new tokens for `to`.
     *
     * See {ERC20-_mint}.
     *
     * Requirements:
     * - the caller must have the `MINTER_ROLE` - for treasury purposes
     * @param to The address of the recipient, and the amount of token wei to mint.
     */
    function mint(address to, uint256 amount) public virtual onlyDAO unlocked(0) {
        _mint(to, amount);
        emit Minted(to, amount);
    }


    /**
     * @dev set the price of the token to be purchased with base coin
     * @param _price wei price for the token
     * 
     **/

    function setTokenPrice(uint256 _price) external onlyDAO {
        price = _price;
        emit PriceChanged(price);
    }

    /**
     * @dev set the amount of wei to pay to the ballot contract
     * @param _payout wei amount to pay to the ballot contract
     * 
     **/

    function setPollPayout(uint256 _payout) external onlyDAO {
        paypoll = _payout; // handle conversion to wei in front end
        emit PolltobePaid(paypoll);
    }

    /**
     * @dev function for paying voter participants
     * @param _voter address of the voter
     */
    function payPoll(address _voter) public onlyBallot unlocked(1) returns(bool success) {
        if (self.transfer(_voter, paypoll)){
            emit PollPaid(_voter, paypoll);
            return true;
        }
        else{
            return false;
        }
    }
    /**
     * @dev function for setting the current ballot
     *
     * @param _ballot address of the ballot contract
     */
    function setBallot(address _ballot) external onlyDAO{
        _setupRole(BALLOT_ROLE, _ballot);
        emit RoleGranted(BALLOT_ROLE, _ballot);
    }

     /** 
     * @dev Function to lock a function call.
     * @param _function name of the function to be locked
     */

     function setLock(uint256 _function) external onlyDAO{
        bool error = true;
        // 1 = mint
        if (_function == 1){
            locked[0] = true;
            error = false;
            emit LockStateChanged(1, locked[0]);
        }
        // 3 = paypoll
        else if (_function == 2){
            locked[1] = true;
            error = false;
            emit LockStateChanged(3, locked[1]);
        }

        else{
        //error message only 2 function locks available
        require(error, "Function not available");
        }
     }

     /** 
     * @dev Function to unlock a function call.
     * @param _function name of the function to be unlocked
     */

     function unLock(uint256 _function) external onlyOwner{
        bool error = true;
        // 1 = mint
        if (_function == 1){
            locked[0] = false;
            error = false;
            emit LockStateChanged(1, locked[0]);
        }
        // 2 = paypoll
        else if (_function == 2){
            locked[1] = false;
            error = false;
            emit LockStateChanged(2, locked[1]);
        }
        else{
        //error message only 2 function locks available
        require(error, "Function not available");
        }
     }

    /**
     * @dev withdraws the balance of the contract
     * @param _to address of the recipient
     */
    function withdrawMatic(address _to) external onlyOwner{
        require(self.balanceOf(address(this)) > 0, "Balance must be greater than 0");
        require(transfer(_to, self.balanceOf(address(this))));
        emit Withdrawn(_to, self.balanceOf(address(this)));
    }

} // end of coin contract

